import "./ContactStyles.css";

import React from "react";
import { AiOutlineMail, AiFillGithub, AiFillLinkedin } from "react-icons/ai";

const Contact = () => {
  return (
    <div className = "link_container">
        <div className = "linked_icon"> <AiOutlineMail size = {40} style = {{color: "black"}}/> <p> Email </p> </div> 
        <div className = "linked_icon"> <AiFillGithub size = {40} style = {{color: "black"}}/> <p> GitHub </p> </div>
        <div className = "linked_icon"> <AiFillLinkedin size = {40} style = {{color: "black"}}/> <p> Linkedin </p> </div> 
    </div>
  )
}

export default Contact
